var validateInterpreter=function(){if($("#InterpreterCompetenceLevel").val()===""||$("#InterpreterCompetenceLevel").val()==="OtherInterpreter"||$("#InterpreterId").val()==="")$(".interpreter-information").addClass("d-none");else{var n="";n=$("#InterpreterId").val()==="-1"?tolkBaseUrl+"Verify/InterpreterByOfficialId?officialInterpreterId="+encodeURIComponent($("#NewInterpreterOfficialInterpreterId").val())+"&orderId="+$("#OrderId").val()+"&competenceLevel="+$("#InterpreterCompetenceLevel").val():tolkBaseUrl+"Verify/InterpreterByInternalId?id="+$("#InterpreterId").val()+"&orderId="+$("#OrderId").val()+"&competenceLevel="+$("#InterpreterCompetenceLevel").val();$.ajax({type:"GET",url:n,dataType:"json",success:function(n){$(".interpreter-information").removeClass("d-none");$(".interpreter-information > span.info-message").text(n.description);n.value===100?$(".interpreter-information").removeClass("warning-info-home").addClass("system-action-info").children("span.glyphicon").removeClass("glyphicon-exclamation-sign").addClass("glyphicon-ok"):$(".interpreter-information").removeClass("system-action-info").addClass("warning-info-home").children("span.glyphicon").removeClass("glyphicon-ok").addClass("glyphicon-exclamation-sign")},error:function(){$(".interpreter-information").addClass("d-none")}})}};